import Row from 'react-bootstrap/esm/Row';
import Col from 'react-bootstrap/esm/Col';

const Cliente = () => {
    return (
        <div>
            <Row className='sobreposicao_cliente'>
            <p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p>
            <p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p>
            <p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p>
            </Row>
        </div>
    )
}

export default Cliente;
